import { EmptyState, Layout, Page } from "@shopify/polaris";

const img = "https://cdn.shopify.com/s/files/1/0757/9955/files/empty-state.svg";
const cardCss = require("../public/css/CardView.css");

const shoifyIndex = (
  <page>
    <Layout>
      <EmptyState
        heading="Ürünlerinizi tanıyın"
        action={{
          content: "Ürün  seçin",
          onAction: () => console.log("clicked"),
        }}
        image={img}
      >
        <p>Takip edilecek ürünleri seçin</p>
      </EmptyState>
    </Layout>
  </page>
);
const Index = () => (
  <div class="parent">
    <div class="card card-2">
    <a href="https://github.com/felicegattuso/datedropper/" target="_blank" class="circle-button">
  <i class="fa fa-github"></i>
</a>
      
    </div>
  </div>
);

const CardIndex = () => <div class="card card-1"></div>;

export default Index;
